faqs:
  columns:
  - id
  - question
  - answer
  - created_at
  - updated_at
  records: 
  - - '1'
    - Why another movie site?
    - ! 'Instead of being overwhelmed by the amount of marketing material on the internet
      about movies, we thought about building a site around people who pay the money
      to watch a movie and their opinions. The next time you are at a multiplex or
      at a DVD store you can use our dashboard to see what australians are currently
      talking about.Each review of not more than 140 characters and score out of 5
      go into the calculations of the leaderboard. '
    - '2013-08-03 08:19:43.309075'
    - '2013-08-03 08:19:43.309075'
  - - '2'
    - Why do we have to register to rate a movie?
    - To prevent users of the site from spam and garbage.
    - '2013-08-03 08:21:34.436934'
    - '2013-08-03 08:21:34.436934'
  - - '3'
    - Why do I have to provide my age,city and country during registration?
    - Providing these will help us in understanding the movie watching trends and
      will reflect in the leaderboard.The idea of the site is built around it.By the
      way we have no interest in sharing your information to anyone.They just go into
      the algorithm anonymously
    - '2013-08-03 08:23:55.315323'
    - '2013-08-03 08:23:55.315323'
  - - '4'
    - How do I access Movie Pulse on mobile?
    - moviepulse.com can be visited on any mobile,tablet or computer.The site is enhanced
      for easy browsing in all these modes and it will adapt to the screen size when
      opened.
    - '2013-08-03 08:41:46.691033'
    - '2013-08-03 08:41:46.691033'

